CREATE TABLE `empresa_test` (
  `id_empresa` int(11) NOT NULL DEFAULT '0',
  `nombre` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `tipo_servicio` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `precio` double(17,0) NOT NULL DEFAULT '0',
  `calificacion` double(17,0) NOT NULL DEFAULT '0',
  `banner` varchar(330) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL
) ENGINE=InnoDB;

